property.value:
local roles = {"PLT", "CPG"}
function init() self.values.x = 0 end
local exclusives = { ["PLT"] = self.parent:findAllByProperty("tag", "PLT", true), ["CPG"] = self.parent:findAllByProperty("tag", "CPG", true), }
function onValueChanged(key) print(table.getn(exclusives["PLT"]))
if (key ~= "x") then return true end
local val = self.values.x + 1
self.parent.name = roles[val]
for i, role in ipairs(roles) do local visible = i == val local e = exclusives[role]
for x, control in ipairs(e) do control.properties.visible = visible end end end
